import axios from 'axios'
import { useEffect, useState } from 'react'
import styles from './App.module.scss';

function App() {
  const [data, setData] = useState([])
  useEffect(
    () => {
      const fetchApi = async () => {
        const data = await axios.get('https://snkrdunk.com/v1/sneakers/DD1391-100/size/list')
        console.log(data.data.data.minPriceOfSizeList)
        const temp = data.data.data.minPriceOfSizeList;
        let index = 0;
        temp.forEach(
          (item) => {
            if(item.size > index) {
              index = item.size
            }
          }
        )
        setData(data.data.data.minPriceOfSizeList)
      }
      fetchApi();

    }, []
  )

  return (
    <div className={styles.wrapper} style={{ minHeight: 1000 }}>
      <ul className={styles.content}>
        {
          data.map(
            (item) => {
              return <li key={item.size}>
                <span>{item.size}: </span>
                <span>{item.price}</span>
              </li>
            }
          )
        }
      </ul>
      {/* <button onClick={}>Cl</button> */}
    </div>
  );
}

export default App;
